    '6340': {"cost": "", "name": "Bedlam", "scepter_mods": [], "scepter": "", "notes": [], "mana": "100 150 200", "cooldown": "40 30 20", "details": [["ATTACK DAMAGE:", "60 140 220"], ["ATTACK INTERVAL:", "0.25"], ["ROAMING DURATION:", "4.0"], ["ATTACK RADIUS:", "300"], ["ATTACK TARGETS:", "1"], ["ROAMING RADIUS:", "200"], ["DAMAGE TYPE:", ["Magical"]], ["PIERCES SPELL IMMUNITY:", ["No"]], ["TARGETS:", ["Enemies"]], ["BEHAVIOR:", ["No Target", "Other (Immediate)"]]], "lore": "You'll have to excuse my friend Jex. He's really into murder.", "icon": "https://storage.googleapis.com/vgv-assets/images/spellicons/dark_willow_bedlam.png", "description": "Dark Willow's pet wisp roams around her for the duration, rapidly attacking nearby enemies.  Bedlam cannot be used while Terrorize is active."},
    '6341': {"cost": "", "name": "Shadow Realm", "scepter_mods": [], "scepter": "", "notes": ["Spells which require vision cannot affect Dark Willow in the Shadow Realm.", "Disjoints projectiles upon cast.", "Grants phased movement."], "mana": "70 80 90 100", "cooldown": "30 24 18 12", "details": [["DURATION:", "5"], ["ATTACK RANGE BONUS:", "600"], ["MAX DAMAGE:", "120 200 280 360"], ["MAX DAMAGE DURATION:", "3"], ["DISPELLABLE:", ["No"]], ["DAMAGE TYPE:", ["Magical"]], ["PIERCES SPELL IMMUNITY:", ["No"]], ["BEHAVIOR:", ["No Target", "Other (Immediate)", "Doesnt Cancel Channeling"]]], "lore": "What you can't see will most definitely hurt you.", "icon": "https://storage.googleapis.com/vgv-assets/images/spellicons/dark_willow_shadow_realm.png", "description": "Dark Willow recedes into the shadows, becoming untargetable.  Her next attack has increased attack range and deals bonus magic damage, and will end Shadow Realm. Damage scales based on how long she remains under the effects of Shadow Realm, the maximum being reached after 3 seconds."},
    '6342': {"cost": "", "name": "Cursed Crown", "scepter_mods": [], "scepter": "", "notes": [], "mana": "100 120 140 160", "cooldown": "18 16 14 12", "details": [["DELAY:", "4"], ["STUN DURATION:", "2 2.5 3 3.5"], ["STUN RADIUS:", "325"], ["CAST POINT:", ["0.1"]], ["TARGET TYPE:", ["Hero", "Non-Ancient"]], ["PIERCES SPELL IMMUNITY:", ["No"]], ["TARGETS:", ["Enemies"]], ["CAST RANGE:", ["600"]], ["BEHAVIOR:", ["Targets Units"]]], "lore": "Didn't anyone ever tell you? Never strike a deal with a fairy...", "icon": "https://storage.googleapis.com/vgv-assets/images/spellicons/dark_willow_cursed_crown.png", "description": "Dark Willow casts an ancient fae curse on the target. After a delay, the target and nearby enemies are stunned."},
